import { useEffect, useState } from "react";

export default function Product() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("/api/Domain/Product")
      .then((res) => res.json())
      .then((res) => {
        setData(res);
      });
  }, []);

  return (
    <div>
      <h1>Products:</h1>
      <ul>
        {data.map((post) => {
          return <li>{post.name}</li>;
        })}
      </ul>
    </div>
  );
}
